import { createBrowserRouter, RouterProvider } from 'react-router-dom';
import Navigation from './components/Navigation';

function App() {
  const router = createBrowserRouter([{ path: '/', element: <Navigation /> }]);
  return <RouterProvider router={router} />;
}

export default App;
